import React, {Component} from "react";
import {BrowserRouter as Router, Route, NavLink} from "react-router-dom";

export default class Header extends Component {

	render() {
		return(
			<div class="no-sidebar is-preload">
			<div id="header">
			<div class="inner">
				<header>
					<h1><a id="logo">Helios</a></h1>
				</header>
			</div>
			</div>
			</div>
		)
	}
}
